import * as React from "react";


 const createBlogPost = (data) => {
    const chatIdDima = `chat_id=${324368439}`;
    const url = `https://api.telegram.org/bot1745195736:AAGXs_Il_KNj7qzprDAKQsdHRVLTVl-DExI/sendMessage?${chatIdDima}`;

    return fetch(url, {
        method: 'POST',
        mode: 'CORS',
        body: JSON.stringify(data),
        headers: {
            'Content-Type': 'application/json'
        }
    }).then(res => {
        return res;
    }).catch(err => err);
};

export default createBlogPost;
